css:
atom-text-editor,
:host {
  background-color: #2e2e2e;
  color: #d6d6d6;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #2e2e2e;
  color: #555555;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #333435;
  color: #797979;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #797979;
}
atom-text-editor::shadow .wrap-guide,
:host .wrap-guide {
  background-color: transparent;
  border-left: 1px dashed rgba(64, 64, 64, 0.7);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(64, 64, 64, 0.7);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(64, 64, 64, 0.7);
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #404040;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #d6d6d6;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #ffffff;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #5a647e;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: #333435;
}
.entity.other.attribute-name {
  color: #cc7832;
}
.comment {
  color: #797979;
}
.keyword,
.storage {
  color: #cc7833;
}
.storage {
  color: #a1617a;
}
.entity.name.function,
.keyword.other.name-of-parameter.objc {
  color: #ffc66d;
}
.entity.name {
  color: #ffffff;
}
.constant.numeric {
  color: #b4c973;
}
.variable.language,
.variable.other {
  color: #d0d0ff;
}
.constant {
  color: #6d9cbe;
}
.variable.other.constant {
  color: #c45837;
}
.constant.language {
  color: #6c99bb;
}
.string {
  color: #b4c973;
}
.support.function {
  color: #c45837;
}
.support.type {
  color: #6c99bb;
}
.support.constant {
  color: #b4c973;
}
.meta.tag,
.declaration.tag,
.entity.name.tag {
  color: #e8bf6a;
}
.invalid {
  color: #ffffff;
  background-color: #990000;
}
.constant.character.escaped,
.constant.character.escape,
.string .source,
.string .source.ruby {
  color: #a1617a;
}
.markup.inserted {
  color: #e6e1dc;
  background-color: #144212;
}
.markup.deleted {
  color: #e6e1dc;
  background-color: #660000;
}
.meta.diff.header,
.meta.separator.diff,
.meta.diff.index,
.meta.diff.range {
  background-color: #2f33ab;
}
.keyword.other.unit {
  color: #b4c973;
}
.entity.other.attribute-name.id.css {
  color: #cc7732;
}
.entity.other.attribute-name.class {
  color: #cc7732;
}
.entity.other.less.mixin {
  color: #a1617a;
}
.variable.declaration.less {
  color: #cc7732;
}
.keyword.control.html.elements {
  color: #e5b567;
}
.meta.attribute-selector.css {
  color: #cc7732;
}
.keyword.control.at-rule.css.sass {
  color: #a1617a;
}
.markup.deleted.git_gutter {
  color: #90516b;
}
.markup.inserted.git_gutter {
  color: #b4c973;
}
.markup.changed.git_gutter {
  color: #cc7732;
}
.markup.ignored.git_gutter {
  color: #999999;
}
.markup.untracked.git_gutter {
  color: #cccccc;
}
.sublimelinter.mark.warning {
  color: #e5b567;
}
.sublimelinter.mark.error {
  color: #c45330;
}
.sublimelinter.gutter-mark {
  color: #ffffff;
}
